  const sendAppHandler = (expense) => {
    console.log(expense);
  };
  return (
    <div>
      <h2>Let's get started!</h2>
      <NewExpense onSendToApp={sendAppHandler} />
      <Expenses item={expenses} />
    </div>
  );
}

export default App;
